CREATE OR REPLACE TABLE `demo`.`users` (id INT NOT NULL , account_id INT, first_name STRING, last_name STRING, email STRING, gender STRING, ip_address STRING, avatar STRING, language STRING, deactivated BOOLEAN, created_at TIMESTAMP NOT NULL, updated_at TIMESTAMP NOT NULL);
CREATE OR REPLACE TABLE `demo`.`admins` (id INT NOT NULL , first_name STRING, last_name STRING, email STRING, permission STRING, created_at TIMESTAMP NOT NULL, updated_at TIMESTAMP NOT NULL);
CREATE OR REPLACE TABLE `demo`.`purchases` (id INT NOT NULL , user_id INT NOT NULL, item STRING, category STRING, price DECIMAL, state STRING, created_at TIMESTAMP NOT NULL);
CREATE OR REPLACE TABLE `demo`.`plans` (id INT NOT NULL , name STRING, seats INT NOT NULL, monthly_rate INT NOT NULL);
CREATE OR REPLACE TABLE `demo`.`accounts` (id INT NOT NULL , name STRING, domain STRING, plan_id INT, created_at TIMESTAMP NOT NULL, updated_at TIMESTAMP NOT NULL);
CREATE OR REPLACE TABLE `demo`.`payments` (id INT NOT NULL , account_id INT NOT NULL, amount DECIMAL, state STRING, created_at TIMESTAMP NOT NULL);
